import React, { useEffect, useState } from "react";
import Nav from "../Global/Nav";

const AllProjects = () => {
  // get employees
  useEffect(() => {
    fetch(`${URL}/employees`)
      .then((res) => res.json())
      .then((json) => setEmployees(json));
  }, []);

  const URL = "http://localhost:8080";
  const [employees, setEmployees] = useState([]);

  return (
    <>
      <Nav />
      {employees.map( ( employee ) => {
        
        return (
          <section className="project-card">
            <h1>New Projects</h1>
            <p>3 projects</p>
            <h2>Proj Name</h2>
            <div style={{ display: "flex" }}>
              <p>Created</p>
              <p>Date</p>
            </div>
            <div style={{ display: "flex" }}>
              <p>Team Lead</p>
              <p>My Nmae</p>
            </div>
            <div style={{ display: "flex" }}>
              <p>Priority</p>
              <p>Lore</p>
            </div>
            <div style={{ display: "flex" }}>
              <p>Dealine</p>
              <p>Role</p>
            </div>
            <div style={{ display: "flex" }}>
              <p>Comments</p>
              <p>Degree</p>
            </div>
            <div style={{ display: "flex" }}>
              <p>Bug</p>
              <p>Mobile</p>
            </div>
            <div style={{ display: "flex" }}>
              <p>Team</p>
              <img
                src=""
                alt="picssss"
              />
            </div>
          </section>
        );
      })}
    </>
  );
};

export default AllProjects;
